import React from "react";
import "./Modal.css";

function Modal({ dateUser, indice }) {
  return (
    <div className=".modalDetails">
      <h1>
        {(key = indice)} {dateUser[indice].id}
      </h1>
    </div>
  );
}

export default Modal;
